import React from "react";
import {format} from "date-fns"
import { Link } from "react-router-dom";
import image from '../public/images/home-office-2804083__340.jpg'

const DefaultPost = ()=>{
    //console.log(createdAt)
    return(
        <div className="post">

        <div className="image">
        <Link to={"/post/065968584"}>
        <img src='client/public/images/1_H06MvmVU9sxQt4fOUmqCHQ.webp' alt=''/>
        </Link>
        </div>
       
        <article className="content">
        <Link id="link" to={`/post/065968584`}>
        <h2>Test</h2>
        </Link>
        <p className="info">  <a className="author">By Sarah</a> <time>{format(new Date(), 'MMM d, yyy HH:mm')}</time></p> 
        <p className="summary">Test</p>
        </article>
        
       
        </div>
       
    )
}

export default DefaultPost;
